import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom'

function ShopList() {

    const navigate = useNavigate()

    const [shopData, setShopData] = useState([
        {
            'shopName':"Malabar",
            'LicenseNumber':223123123242,
            'rating':5
        },
        {
            'shopName':"Malabar",
            'LicenseNumber':223123123242,
            'rating':5
        },
    ])
  return (
    <div className='flex'>
        {shopData.map(shop=>{
            return (
                <div  onClick={()=>navigate('store')} className='border border-gray-500 p-3 m-2 rounded-md cursor-pointer'>
                 <p>{shop.shopName}</p>
                <p>SLicense {shop.LicenseNumber}</p>
                <p>Shop Rating {shop.rating}</p>

                </div>
     
            )
        })}
    </div>
  )
}

export default ShopList
